"use strict";(self.webpackChunknetworkmanager=self.webpackChunknetworkmanager||[]).push([[5812],{5514:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"improved-light-theme-readability","metadata":{"permalink":"/NETworkManager/blog/improved-light-theme-readability","editUrl":"https://github.com/bornToBeRoot/NETworkManager/tree/main/Website/blog/2025-10-23-improved-light-theme-readability/index.md","source":"@site/blog/2025-10-23-improved-light-theme-readability/index.md","title":"Improved light theme readability","description":"The latest release of NETworkManager (version 2025.10.18.0) introduces major enhancements to the light theme, improving both readability and overall user experience.","date":"2025-10-23T00:00:00.000Z","tags":[{"inline":true,"label":"theme","permalink":"/NETworkManager/blog/tags/theme"},{"inline":true,"label":"ui","permalink":"/NETworkManager/blog/tags/ui"}],"readingTime":0.8,"hasTruncateMarker":true,"authors":[{"name":"BornToBeRoot","title":"Maintainer of NETworkManager","url":"https://github.com/BornToBeRoot","imageURL":"https://github.com/BornToBeRoot.png","key":"borntoberoot","page":null}],"frontMatter":{"slug":"improved-light-theme-readability","title":"Improved light theme readability","authors":["borntoberoot"],"tags":["theme","ui"]},"unlisted":false,"nextItem":{"title":"Streamlined Profile Management with Tags & Filters","permalink":"/NETworkManager/blog/streamlined-profile-management-with-tags-and-filters"}},"content":"The latest release of NETworkManager (version 2025.10.18.0) introduces major enhancements to the light theme, improving both readability and overall user experience.\\n\\nIn this version, the code that handles theming has been completely rewritten, providing granular control over colors and styles. This allows users to fine-tune the light and dark themes independently, ensuring better contrast, visibility, and accessibility across the interface.\\n\\nThe light theme has already received several improvements to enhance readability, and more adjustments are planned for future releases based on user feedback. So please don\u2019t hesitate to share your thoughts on the [GitHub issue tracker](https://github.com/BornToBeRoot/NETworkManager/issues).\\n\\n![Light theme preview](./light-theme-preview.png)\\n\\n\x3c!-- truncate --\x3e\\n\\nUpgrade now to the [latest version of NETworkManager](https://borntoberoot.net/NETworkManager/download) to use this feature.\\n\\nMore information is available in the [official documentation](https://borntoberoot.net/NETworkManager/docs/settings/appearance).\\n\\nIf you find any issues or have suggestions for improvement, please open an [issue on GitHub](https://github.com/BornToBeRoot/NETworkManager/issues)."},{"id":"streamlined-profile-management-with-tags-and-filters","metadata":{"permalink":"/NETworkManager/blog/streamlined-profile-management-with-tags-and-filters","editUrl":"https://github.com/bornToBeRoot/NETworkManager/tree/main/Website/blog/2025-10-19-streamlined-profile-management-with-tags-and-filters/index.md","source":"@site/blog/2025-10-19-streamlined-profile-management-with-tags-and-filters/index.md","title":"Streamlined Profile Management with Tags & Filters","description":"NETworkManager 2025.10.18.0 brings a streamlined approach to profile management with the introduction of Tags and Filtering.","date":"2025-10-19T00:00:00.000Z","tags":[{"inline":true,"label":"profile management","permalink":"/NETworkManager/blog/tags/profile-management"},{"inline":true,"label":"tags","permalink":"/NETworkManager/blog/tags/tags"},{"inline":true,"label":"new feature","permalink":"/NETworkManager/blog/tags/new-feature"}],"readingTime":0.95,"hasTruncateMarker":true,"authors":[{"name":"BornToBeRoot","title":"Maintainer of NETworkManager","url":"https://github.com/BornToBeRoot","imageURL":"https://github.com/BornToBeRoot.png","key":"borntoberoot","page":null}],"frontMatter":{"slug":"streamlined-profile-management-with-tags-and-filters","title":"Streamlined Profile Management with Tags & Filters","authors":["borntoberoot"],"tags":["profile management","tags","new feature"]},"unlisted":false,"prevItem":{"title":"Improved light theme readability","permalink":"/NETworkManager/blog/improved-light-theme-readability"},"nextItem":{"title":"Introducing Hosts File Editor","permalink":"/NETworkManager/blog/introducing-hosts-file-editor"}},"content":"NETworkManager 2025.10.18.0 brings a streamlined approach to profile management with the introduction of Tags and Filtering.\\n\\nYou can now add or remove tags directly within each profile, making it effortless to organize and quickly locate your hosts and networks.\\n\\n![Profile Tags & Filters](./profile-tags-and-filters.gif)\\n\\n\x3c!-- truncate --\x3e\\n\\nEasily filter profiles across features using the new filter button next to the search box.\\n\\nChoose between two filter modes:\\n\\n- Match All: Display profiles containing all selected tags (e.g., `prod` and `dns`).\\n- Match Any: Display profiles containing at least one selected tag (e.g., `prod` or `dev`).\\n\\nAdditionally, profile groups are now more manageable. Right-click any group header to access a new context menu, allowing you to expand or collapse all groups with a single click.\\n\\nThese enhancements make managing large profile sets faster, cleaner, and more intuitive than ever.\\n\\nUpgrade now to the [latest version of NETworkManager](https://borntoberoot.net/NETworkManager/download) to use this feature.\\n\\nMore information is available in the [official documentation](https://borntoberoot.net/NETworkManager/docs/groups-and-profiles).\\n\\nIf you find any issues or have suggestions for improvement, please open an [issue on GitHub](https://github.com/BornToBeRoot/NETworkManager/issues)."},{"id":"introducing-hosts-file-editor","metadata":{"permalink":"/NETworkManager/blog/introducing-hosts-file-editor","editUrl":"https://github.com/bornToBeRoot/NETworkManager/tree/main/Website/blog/2025-09-06-introducing-hosts-file-editor/index.md","source":"@site/blog/2025-09-06-introducing-hosts-file-editor/index.md","title":"Introducing Hosts File Editor","description":"NETworkManager 2025.8.10.0 introduced a new feature, the Hosts File Editor. You can now easily manage and edit your system\'s hosts file in a user-friendly interface.","date":"2025-09-06T00:00:00.000Z","tags":[{"inline":true,"label":"hosts file","permalink":"/NETworkManager/blog/tags/hosts-file"},{"inline":true,"label":"dns","permalink":"/NETworkManager/blog/tags/dns"},{"inline":true,"label":"new feature","permalink":"/NETworkManager/blog/tags/new-feature"}],"readingTime":1.12,"hasTruncateMarker":true,"authors":[{"name":"BornToBeRoot","title":"Maintainer of NETworkManager","url":"https://github.com/BornToBeRoot","imageURL":"https://github.com/BornToBeRoot.png","key":"borntoberoot","page":null}],"frontMatter":{"slug":"introducing-hosts-file-editor","title":"Introducing Hosts File Editor","authors":["borntoberoot"],"tags":["hosts file","dns","new feature"]},"unlisted":false,"prevItem":{"title":"Streamlined Profile Management with Tags & Filters","permalink":"/NETworkManager/blog/streamlined-profile-management-with-tags-and-filters"},"nextItem":{"title":"Introducing Code Signing for Binaries","permalink":"/NETworkManager/blog/introducing-code-signing-for-binaries"}},"content":"NETworkManager 2025.8.10.0 introduced a new feature, the `Hosts File Editor`. You can now easily manage and edit your system\'s hosts file in a user-friendly interface.\\n\\nAs a sysadmin or developer, you often need to modify the hosts file in order to override DNS settings for specific domains, redirect traffic, or test websites locally.\\n\\n![Hosts File Editor](./hosts-file-editor.gif)\\n\\n\x3c!-- truncate --\x3e\\n\\nThe hosts file is a plain text file used by the operating system to map hostnames to IP addresses. It is typically located at:\\n\\n- Windows: `C:\\\\Windows\\\\System32\\\\drivers\\\\etc\\\\hosts`\\n- Linux: `/etc/hosts`\\n\\nEditing this file usually requires administrative privileges and can be cumbersome using traditional text editors.\\nWith the new Hosts File Editor in NETworkManager, you can now easily add, edit, enable, disable, or delete entries\\nin your hosts file without needing to manually open and edit the file.\\n\\nA daily backup (up to 5 versions) of the hosts file is created automatically before any changes are applied,\\nallowing you to restore previous versions if needed.\\n\\nUpgrade now to the [latest version of NETworkManager](https://borntoberoot.net/NETworkManager/download) to use this feature.\\n\\nMore information is available in the [official documentation](https://borntoberoot.net/NETworkManager/download/docs/application/hosts-file-editor).\\n\\nIf you find any issues or have suggestions for improvement, please open an [issue on GitHub](https://github.com/BornToBeRoot/NETworkManager/issues)."},{"id":"introducing-code-signing-for-binaries","metadata":{"permalink":"/NETworkManager/blog/introducing-code-signing-for-binaries","editUrl":"https://github.com/bornToBeRoot/NETworkManager/tree/main/Website/blog/2024-05-24-introducing-code-signing-to-binaries/index.md","source":"@site/blog/2024-05-24-introducing-code-signing-to-binaries/index.md","title":"Introducing Code Signing for Binaries","description":"Starting with NETworkManager version 2024.5.24.0, the binaries and the installer are now signed with a code signing certificate.","date":"2024-05-24T00:00:00.000Z","tags":[{"inline":true,"label":"code-signing","permalink":"/NETworkManager/blog/tags/code-signing"},{"inline":true,"label":"binaries","permalink":"/NETworkManager/blog/tags/binaries"},{"inline":true,"label":"installer","permalink":"/NETworkManager/blog/tags/installer"}],"readingTime":0.53,"hasTruncateMarker":true,"authors":[{"name":"BornToBeRoot","title":"Maintainer of NETworkManager","url":"https://github.com/BornToBeRoot","imageURL":"https://github.com/BornToBeRoot.png","key":"borntoberoot","page":null}],"frontMatter":{"slug":"introducing-code-signing-for-binaries","title":"Introducing Code Signing for Binaries","authors":["borntoberoot"],"tags":["code-signing","binaries","installer"]},"unlisted":false,"prevItem":{"title":"Introducing Hosts File Editor","permalink":"/NETworkManager/blog/introducing-hosts-file-editor"},"nextItem":{"title":"Welcome","permalink":"/NETworkManager/blog/welcome"}},"content":"Starting with NETworkManager version 2024.5.24.0, the binaries and the installer are now signed with a code signing certificate.\\n\\n\x3c!-- truncate --\x3e\\n\\nThe binaries and installer are built on [AppVeyor](https://ci.appveyor.com/project/BornToBeRoot/networkmanager) directly from the [GitHub repository](https://github.com/BornToBeRoot/NETworkManager/blob/main/appveyor.yml).\\nBuild artifacts are automatically sent to [SignPath.io](https://signpath.io/) via webhook, where they are signed after manual approval by the maintainer.\\nThe signed binaries are then uploaded to the [GitHub releases](https://github.com/BornToBeRoot/NETworkManager/releases) page.\\n\\nSpecial thanks goes to [SignPath.io](https://signpath.io/) for providing free code signing and the [SignPath Foundation](https://signpath.org/) for the free code signing certificate."},{"id":"welcome","metadata":{"permalink":"/NETworkManager/blog/welcome","editUrl":"https://github.com/bornToBeRoot/NETworkManager/tree/main/Website/blog/2024-01-01-welcome/index.md","source":"@site/blog/2024-01-01-welcome/index.md","title":"Welcome","description":"Welcome to the new NETworkManager website, blod and documentation.","date":"2024-01-01T00:00:00.000Z","tags":[{"inline":true,"label":"welcome","permalink":"/NETworkManager/blog/tags/welcome"},{"inline":true,"label":"docusaurus","permalink":"/NETworkManager/blog/tags/docusaurus"}],"readingTime":0.22,"hasTruncateMarker":true,"authors":[{"name":"BornToBeRoot","title":"Maintainer of NETworkManager","url":"https://github.com/BornToBeRoot","imageURL":"https://github.com/BornToBeRoot.png","key":"borntoberoot","page":null}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["borntoberoot"],"tags":["welcome","docusaurus"]},"unlisted":false,"prevItem":{"title":"Introducing Code Signing for Binaries","permalink":"/NETworkManager/blog/introducing-code-signing-for-binaries"}},"content":"Welcome to the new NETworkManager website, blod and documentation.\\n\\nIt\'s build with [Docusaurus](https://docusaurus.io/), a static website generator, and hosted on [GitHub Pages](https://pages.github.com/).\\n\\n\x3c!-- truncate --\x3e\\n\\nYou can help to improve the documentation by submitting a [pull request](https://github.com/BornToBeRoot/NETworkManager)."}]}}')}}]);